  true,\n\t\"url\": null,\n\t\"notes\": \"Energy intensity data and documentation
  published by the U.S. DOE's office of Energy Efficiency and Renewable Energy (EERE).
  Energy intensity is defined as: amount of energy used in producing a given level
  of output or activity; expressed as energy per unit of output. This is the energy
  intensity of the the industrial sector, which is an end-use that consists of all
  facilities and equipment used for producing, processing, or assembling goods. It
  is comprised of: manufacturing, agriculture, forestry, fisheries, mining and construction.
  Data is available for the period 1949 - 2004.\",\n\t\"license_title\": \"Other License
